import React, {Component} from 'react';
import './signUp.css';

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faChevronDown} from "@fortawesome/free-solid-svg-icons";

class SignUp extends Component {
    render() {
        return (
            <section className="signUpSection">
                <form method="post" className="formSignUp">
                    <h1>Inscription</h1>
                    <span>Inscrivez-vous !</span><br/>
                    <input type="email" id="email"/><br/>
                    <input type="email" id="confirmEmail"/><br/>
                    <input type="text" id="username"/><br/>
                    <input type="password" id="password"/><br/>
                    <input type="password" id="confirmPassword"/><br/>
                    <input type="button" id="submitSignUp"/><br/>
                </form>
                <div className="accordeon">
                    <div className="spanSpace">
                        <span>Quelles sont les informations requises pour ouvrir un compte Clausius Investments ?</span><FontAwesomeIcon className="fasChevron" icon={faChevronDown}/><br/>
                    </div>
                    <div className="spanSpace">
                        <span>Quelles sont les informations requises pour ouvrir un compte Clausius Investments ?</span><FontAwesomeIcon className="fasChevron" icon={faChevronDown}/><br/>
                    </div>
                    <div className="spanSpace">
                        <span>Quelles sont les informations requises pour ouvrir un compte Clausius Investments ?</span><FontAwesomeIcon className="fasChevron" icon={faChevronDown}/>
                    </div>
                </div>
            </section>
        );
    }
}

export default SignUp
